'''Ancient dragonhide set''' is an item obtained by exchanging a set of items with a [[Grand Exchange clerk]] via their right-click "Sets" option and clicking on the appropriate item set within the Item Sets interface.

Sets are commonly used to reduce the amount of bank space taken up.

The [[Ancient d'hide shield]] and [[Ancient d'hide boots|boots]] are '''not''' required to assemble this item set.
